  var content_default = [{ "path": "scribble/ClockCamera.md", "content": "---\ncreatedAt: 2022-08-08T00:30:05+00:00\ntags: \n - project\n---\n[ClockCamera](http://clock.camera) is a toy I envisaged sharing with my children - an excuse to do craft projects and take interesting photos, with the end goal of creating interesting digital clocks.\n\nBuilt on Firebase and MUI, the source is available [here](http://clock.camera)." }, { "path": "scribble/Dictionarily.md", "content": "---\ncreatedAt: 2022-08-08T03:32:26+00:00\ntags: \n - project\n---\nI've always been interested in word games, and found playing them socially online a great joy. \n\nDeveloping your own Wordle, etc, is an easy ambition to imagine - the first thing you need, though, is a reliable dictionary.\n\nDictionarily is a service that publishes dictionaries - dictionaries that can be be efficiently consumed in places like web games. The current version is published [here](https://github.com/simonhildebrandt/dictionarily) - it uses a [trie data structure](https://github.com/kamilmielnik/trie) in the published corpus, which reduces the delivered size while also providing a streamlined hydration mechanism for the client. \n\nUltimately the goal is to provide a sophisticated interface where customers can build and combine (add, subtract) different source dictionaries into a variety of personalised dictionaries to serve different groups of users (based on language or other constraints.)" }, { "path": "scribble/Gaming The Future 1.md", "content": "---\ncreatedAt: 2022-08-02T00:01:50+00:00\ntags: \n - podcasting\n---\nMy new series of fact articles, [Gaming the Future, has debut'd on Starship Sofa](http://www.starshipsofa.com/2012/09/19/starshipsofa-no-256-charlie-jane-anders/). For those who are interested, he's some supporting information.\n\n1.  Get the games - [Portal 1](http://store.steampowered.com/app/400/) and [Portal 2](http://store.steampowered.com/app/620/). Or the highly recommended [Orange Box](http://store.steampowered.com/sub/469/).\n2.  [Get the soundtrack for Portal 2 - free!](http://www.thinkwithportals.com/music.php)\n3.  The Portal 2 comic, illustrated by Michael Avon Oeming and Andrea Wicklund, written by Ted Kosmatka - [Lab Rat](http://www.thinkwithportals.com/comic/).\n\nLook out for episode #2 - Homeworld.\n\nOur music is by [Cheapshot](http://cheapshot.bandcamp.com/), from the album [Streets of Bass](http://cheapshot.bandcamp.com/album/streets-of-bass), used with permission." }, { "path": "scribble/Gaming The Future 2.md", "content": "---\ncreatedAt: 2022-08-08T07:07:32+00:00\ntags: \n - podcasting\n---\nFor those interested in more information about the Homeworld games, I'd recommend the following links:\n\n-   [Watch the cinematics on YouTube](http://www.youtube.com/watch?v=yrW4jkQdmjI) - they're lovely, and give you a good background for the game.\n-   [Relic's download page for Homeworld-related stuff](http://www.relicnews.com/homeworld/hw-downloads/) - demos, patches, desktop themes - even the source code of the game, and a unit viewer.\n\nHope you enjoyed my article, and I'll see you in a month, with my next topic: Frank Herbert's Dune.\n\nOur music is by [Cheapshot](http://cheapshot.bandcamp.com/), from the album [Streets of Bass](http://cheapshot.bandcamp.com/album/streets-of-bass), used with permission." }, { "path": "scribble/Gaming The Future 3.md", "content": "---\ncreatedAt: 2022-08-08T07:08:52+00:00\ntags: \n - podcasting\n---\nFor those interested in digging a little deeper into the Dune games, following [my new 'Gaming the Future' article](http://www.starshipsofa.com/2012/11/06/starshipsofa-no-263-pamela-sargent/), I recommend:\n\n1.  [Checking out the soundtrack of Dune 1 on Youtube](http://www.youtube.com/watch?v=FjHon6yg-r8&feature=related).\n2.  [Take a look at the list of Dune games on Wikipedia](http://en.wikipedia.org/wiki/List_of_Dune_games).\n3.  [Checking out the original film](http://www.imdb.com/title/tt0087182/).\n\nOur music is by [Cheapshot](http://cheapshot.bandcamp.com/), from the album [Streets of Bass](http://cheapshot.bandcamp.com/album/streets-of-bass), used with permission." }, { "path": "scribble/Gaming The Future 4.md", "content": `---
createdAt: 2022-08-08T07:09:57+00:00
tags: 
 - podcasting
---
For those following my [Starship Sofa column](http://www.starshipsofa.com/2012/12/19/starshipsofa-no-269-alec-nevala-lee-part-1/), or just interested in information about Startopia, try these links:

1.  Wikipedia: [http://en.wikipedia.org/wiki/Startopia](http://en.wikipedia.org/wiki/Startopia)
2.  Opening cinematic on youtube: [http://www.youtube.com/watch?v=jK79tBd6EZw](http://www.youtube.com/watch?v=jK79tBd6EZw)
3.  Development postmortem: [http://www.gamasutra.com/view/feature/131436/postmortem_startopia.php](http://www.gamasutra.com/view/feature/131436/postmortem_startopia.php)
4.  Play guide: [http://www.rakrent.com/rtsc/rtsc_startopia.htm](http://www.rakrent.com/rtsc/rtsc_startopia.htm)
5.  Buy Startopia from GOG: [http://www.gog.com/gamecard/startopia](http://www.gog.com/gamecard/startopia)

_**Bonus: VAL quotes**_

Including my favourite: "Ask those aliens if they've crashed into the New Mexico desert lately. I dare you."

[http://forums.eidosgames.com/archive/index.php/t-17524.html](http://forums.eidosgames.com/archive/index.php/t-17524.html)

Our music is by [Cheapshot](http://cheapshot.bandcamp.com/), from the album [Streets of Bass](http://cheapshot.bandcamp.com/album/streets-of-bass), used with permission.` }, { "path": "scribble/Gaming The Future 5.md", "content": "---\ncreatedAt: 2022-08-08T07:10:32+00:00\ntags: \n - podcasting\n---\nFor those interested in [my latest column on Starship Sofa](http://www.starshipsofa.com/2013/02/13/starshipsofa-no-276-ken-liu/) about the game Another World, here's a few quick links to help out:\n\n-   More info on [Wikipedia](http://en.wikipedia.org/wiki/Another_World_(video_game)),\n-   buy the game at [GOG.com](http://www.gog.com/gamecard/another_world_15th_anniversary_edition), or\n-   buy it on the [Android Play Store](https://play.google.com/store/apps/details?id=com.dotemu.anotherworld&hl=en).\n\nOur music is by [Cheapshot](http://cheapshot.bandcamp.com/), from the album [Streets of Bass](http://cheapshot.bandcamp.com/album/streets-of-bass), used with permission." }, { "path": "scribble/L5.md", "content": "---\ncreatedAt: 2022-08-08T03:32:26+00:00\ntags: \n - project\n - games\n---\nL5 is a game concept - a cute management sim where the player builds and tunes a 3D modular space habitat.\n\nCurrent ambition is to prototype in Unity, exploring controls, art and core systems.\n\nExamples of modules:\n - Basic hab  \n - Power: Solar, fission, fusion  \n - Batteries  \n - Water tanks  \n - Storage  \n - Dormitory  \n - Hydroponics  \n - Kitchen  \n - Engineering, fabrication  \n - Smelting  \n - Air processing  \n - Engines  \n - Armour  \n - Weapons  \n - Comms  \n - Mining  \n - Access tube  \n - Waste processing?  \n  \nResources: Water, bio-waste, air, power, food, metal  \n  \n[https://space.nss.org/settlement/nasa/70sArtHiRes/70sArt/art.html](https://space.nss.org/settlement/nasa/70sArtHiRes/70sArt/art.html)" }, { "path": "scribble/Light Tiles.md", "content": "---\ncreatedAt: 2022-07-15T00:01:50+00:00\ntags: \n - project\n - electronics\n---\n\nA design for tileable panels, similar to Nanoleaf \n\n[XIAO BT prototyping board](https://www.seeedstudio.com/Seeed-XIAO-BLE-nRF52840-p-5201.html), mounted with headers onto custom PCB, with addressable RGBs  \n\nTranslucent plastic cover as diffuser\n  \n[Paired magnetic connectors](https://www.aliexpress.com/item/1005003079080793.html) on hinged mount to allow dodecahedron arrangement  \n" }, { "path": "scribble/Login With Link.md", "content": "---\ncreatedAt: 2022-08-08T00:30:05+00:00\ntags:\n - project\n---\nWhen I started using [Firebase](https://firebase.google.com/) I found two things awkward (that were supposedly strengths of the platform!) - securing access to data, and user authentication.\n\nI still struggle with access control, but to take control of my auth issues I decided to try building my own solution. The result: [Login With Link](http://login-with.link) - a minimal passwordless authentication system.\n\nIt uses Firebase (ironically) for hosting, database and cloud functions, and Amazon's SES for email sending. It's currently free for hobbyist usage, and the code is [here](https://github.com/simonhildebrandt/login-with-link)." }, { "path": "scribble/New Site.md", "content": "---\ncreatedAt: 2022-08-02T00:01:50+00:00\ntags: \n - project\n---\n[simonhildebrandt.com](http://simonhildebrandt.com) badly needs an update, so I'm starting a new project to create something that's reasonably live.\n\n### Basic requirements\n - Markdown content managed through [Obsidian](https://obsidian.md/) \n - Hosting through [Firebase](https://firebase.google.com/)\n - Deployment via [Github Actions]([https://github.com/marketplace/actions/deploy-to-firebase-hosting#options](https://github.com/marketplace/actions/deploy-to-firebase-hosting#options))\n - Templated static HTML (for SSO) overlaid with [Chakra UI](https://chakra-ui.com/) based themed view\n\n### Advanced Features\n - RSS\n - Full text search, tag filtering\n " }, { "path": "scribble/Podcasting.md", "content": `---
createdAt: 2022-08-02T00:01:50+00:00
tags: 
 - podcasting
---
I've loved stories read aloud ever since my parents read to me as a child. So when I discovered podcasting and fiction narration, I knew I had to give it a try.

# Hosting

I took over hosting duties for the (now mothballed) [Protecting Project Pulp podcast](http://ppp.requisite.link), where assistant editor Fred Himebaugh, sound engineer Tom O'Dwyer, producer Tony Smith and myself brought a new classic pulp-era story to the airwaves every week.

# Narrating

So far I've read stories for the following District of Wonders podcasts - [Starship Sofa](http://www.starshipsofa.com/), [Tales to Terrify](http://talestoterrify.com/) and [Protecting Project Pulp](http://protectingprojectpulp.com/) - and Amanda McCall's romance podcast, [RomPod](http://rompod.com/) (now defunct). I'm hoping to contribute to [Librivox](http://librivox.org/) some day, and I'd love to contribute to other fiction podcasts too.

1.  Frankenstein, Frankenstein by [Will McIntosh](http://en.wikipedia.org/wiki/Will_McIntosh) - published in [Starship Sofa #195](http://www.starshipsofa.com/blog/2011/06/29/starshipsofa-no-195-will-mcintosh/) (10:50)
2.  Eight Miles by [Sean McMullen](http://www.seanmcmullen.net.au/news.htm) - published in [Starship Sofa #189](http://www.starshipsofa.com/blog/2011/05/18/starshipsofa-no-189-sean-mcmullen/) (43:50)
3.  [Arrhythmia](http://www.mutationpress.com/Arrhythmia%20BFSA%20shortlist.pdf) by Neil Williamson - published in [Starship Sofa #178](http://www.starshipsofa.com/blog/2011/03/03/starshipsofa-no-178-bsfa-best-short-story-nominations/)
4.  A Professor At Harvard by [David Brin](http://www.davidbrin.com/) - published in [Starship Sofa #174](http://www.starshipsofa.com/blog/2011/02/02/starshipsofa-no-174-david-brin-damon-knight/) (01:03:30)
5.  Death of a Spaceman by [Walter M. Miller](http://en.wikipedia.org/wiki/Walter_M._Miller,_Jr.) - published in [Starship Sofa #161](http://www.starshipsofa.com/blog/2010/11/05/aural-delights-no-161-walter-m-miller/) (30:00)
6.  Never Blood Enough by [Joe Haldeman](http://home.earthlink.net/~haldeman/) - published in [Starship Sofa #208](http://www.starshipsofa.com/blog/2011/10/19/starshipsofa-no-208-joe-haldeman/) (38:00)
7.  In My House of Crafted Cards by [David Thomas Lord](http://www.fantasticfiction.co.uk/l/david-thomas-lord/) - published in [Tales to Terrify #9](http://talestoterrify.com/tales-to-terrify-no-9-david-thomas-lord/) (37:50)
8.  Green Apples, Red Nails by [John Everson](http://www.johneverson.com/) - published in [Tales to Terrify #7](http://talestoterrify.com/tales-to-terrify-no-7-john-everson) (39:40)
9.  Hypergraphia by Ken Lillie-Paetz - published in [Tales to Terrify #10](http://talestoterrify.com/tales-to-terrify-no-10-bram-stoker-awards-special-part-2/) (48:22)
10.  Greenland by Chris Beckett - published in [Starship Sofa #253](http://www.starshipsofa.com/2012/08/29/starshipsofa-no-253-chris-beckett/) (19:20)
11.  Raider of the Spaceways by Henry Kuttner - published in [Protecting Project Pulp #16](http://protectingprojectpulp.com/protecting-project-pulp-no-16-henry-kuttner/) (3:00)
12.  Impulse Control by Susan Bischoff - published in [RomPod #6](http://rompod.com/post/42306680966/episode-6-susan-bischoff-impulse-control)
13.  Private Dancer by Ciar Cullen - published in [RomPod #13](http://rompod.com/post/46887403486/episode-13-ciar-cullen-private-dancer)
14.  At the Sign of the Black Dove by [Lou Morgan](http://www.loumorgan.co.uk/) - published in [Tales to Terrify #71](http://talestoterrify.com/tales-to-terrify-no-71-neputin-morgan/) (24:18)
15.  The Opener of the Way by Robert Bloch - published in [Protecting Project Pulp #59](http://protectingprojectpulp.com/protecting-project-pulp-59-robert-bloch/)
16.  World\u2019s End by Henry Kuttner - published in [Protecting Project Pulp #74](http://protectingprojectpulp.com/protecting-project-pulp-74-henry-kuttner/)
17.  Inspector Zhang Gets His Wish by [Stephen Leather](http://www.stephenleather.com/) - published in [Crime City Central #106](http://crimecitycentral.com/crime-city-central-no-106-stephen-leather/)

# Gaming the Future

In addition to narrating stories I've also started contributing periodic articles - currently I'm doing "Gaming the Future" for Starship Sofa.

1.  Gaming the Future #1: Portal 1 & 2 in [Starship Sofa #256](http://www.starshipsofa.com/2012/09/19/starshipsofa-no-256-charlie-jane-anders/) (8:40) [[Gaming The Future 1|show notes]]
2.  Gaming the Future #2: Homeworld 1, Cataclysm & 2 in [StarShipSofa #260](http://www.starshipsofa.com/2012/10/17/starshipsofa-no-260-bradner-buckner/) (4:00) [[Gaming The Future 2|show notes]]
3.  Gaming the Future #3: Dune in [Starship Sofa #263](http://www.starshipsofa.com/2012/11/06/starshipsofa-no-263-pamela-sargent/) (7:50) [[Gaming The Future 3|show notes]]
4.  Gaming the Future #4: Startopia in [Starship Sofa #269](http://www.starshipsofa.com/2012/12/19/starshipsofa-no-269-alec-nevala-lee-part-1/) [[Gaming The Future 4|show notes]]
5.  Gaming the Future #5: Another World in [Starship Sofa #276](http://www.starshipsofa.com/2013/02/13/starshipsofa-no-276-ken-liu/) (1:07) [[Gaming The Future 5|show notes]]

# Recommended Podcasts

-   Beware the Hairy Mango
-   Escape Pod
-   Drabblecast MP3
-   Drabblecast B-Sides
-   The Dunesteef Audio Fiction Magazine
-   the memory palace
-   tor.com / category / tordotstories
-   Cossmass Infinities
-   Cory Doctorow's craphound.com \xBB Podcast
-   Nature Podcast
-   The Moth Podcast
-   WNYC's Radiolab
-   The Sofanauts
-   Quirks & Quarks Segmented Show from CBC Radio
-   Rudy Rucker on GigaDial Public
-   Lightspeed Magazine
-   StarShip Sofa` }, { "path": "scribble/Radiator.md", "content": "---\ncreatedAt: 2020-12-01T00:01:50+00:00\ntags: \n - project\n---\nWe have a recurring problem in my household - we want to know the same things (current date/time, weather forecast, upcoming calendar events) several times a day, every day, and we each have to fumble individually for a phone to find those things out.\n\nSolution: an ambient screen - an information radiator.\n\n## Ideas\nI'd love to use an e-ink display - both for power consumption and aesthetic. A light, low power PC like a Raspberry Pi would suit the scale of the project. Future-proofing would be nice too - using the computer for other services like [Plex](http://plex.tv) would be great.\n\n### Implementation\n#### Hardware\n - [DFRobot 10.1\" 800x1280 mini-HDMI IPS Display](http://dfrobot.com/product-2063.html). First casualty of the 'light and simple' ethos was the e-ink display - both affording and driving one started to seem way too difficult. Instead we've got a simple little HDMI display - powered by USB (so it's easily hosted the PC) and very reasonably priced.\n - [Gigabyte BRIX-s](https://www.gigabyte.com/au/Mini-PcBarebone/BRIX-s). Here's where I went a little crazy. Instead of 'the simplest thing that works', I started thinking about the 'future-proofing' angle and Plex, and ended up grabbing one of these (from [PC Case Gear](https://www.pccasegear.com/products/48357/gigabyte-brix-gb-blce-4105r-barebone-kit).)\n \n#### Software\n - [Ubuntu](https://ubuntu.com/). Had everything I needed - startup items, solid browser, up to date, good support for third party stuff like Plex.\n - [radiator.link](radiator.link). (More about this below.)\n \n#### The build\n\nThe Gigabyte system was very easy to put together - sensibly designed with good instructions. Dropped in a 	Kingston A400 2.5in SATA SSD 480GB and some Kingston ValueRAM 8GB (1x8GB) 2400MHz CL17 DDR4 SODIMM (also from PC Case Gear), added a USB hard drive [configured using the Ubuntu bootable drive instructions](https://ubuntu.com/tutorials/create-a-usb-stick-on-windows#1-overview) and it booted perfectly the first time. \n\n#### Configuration\n\nOnce I had Ubuntu up and running (after a little fiddling with my wifi config to disable AP isolation so I could connect to it) it was time to get it configured.\n\n1. SSH access. Super simple - just `apt-get install openssh-server`, and [keep an eye out for the firewall](openssh-server).\n2. Tweak the display. The notes for the monitor apologetically explain that it starts in portrait mode - but actually this was what I wanted. What I quickly realised though is that the cables plug into what is then the 'top' of the display, so I flipped the display in Ubuntu's display settings.\n\nNext I had to think about the actual presentation - what I wanted to display, and how. I wanted a kind of 'kiosk mode' - no OS chrome, no mouse pointer, no login. Simple things first - `apt-get install unclutter` gave me the mouse hiding behaviour I wanted, just by adding `unclutter -idle 1.0 -root` as a startup item; and Ubuntu includes [automatic login](https://help.ubuntu.com/stable/ubuntu-help/user-autologin.html.en) as a preference.\n\nThen, information display. I wanted something configurable, with at least date and time, weather forecast, calendar events. Being a web developer my first thought was to whip something up using those tools, and with a little experimentation I found that Firefox has a built in kiosk mode that I could exploit by creating another startup item like this: `firefox --kiosk https://radiator.link/for/our-cool-radiator`.\n\n#### [Radiator.link](http://radiator.link)\n\nI felt like I was going to be hacking on this for a while, and that it might be useful for others too, so I [grabbed a cheap domain name](https://www.crazydomains.com.au/) (not so cheap after I had to spending twice the cost of the domain for basic TXT record tools, frustratingly) and some handy [Firebase hosting](https://firebase.google.com/products/hosting).\n\nThe site is my [default barebones web stack](https://github.com/simonhildebrandt/my-webbapp-starter) - [Browserify](http://browserify.org/), [Babel](https://babeljs.io/), [React](https://reactjs.org/), plus best-in-class supporting libraries [Luxon](https://moment.github.io/luxon/) and [Axios](https://github.com/axios/axios). (In the future it'll use Firebase for managing personal details, for customisation.)\n\nThe finished result (plus photobomber.)\n\n![radiator screen with photobomber](assets/radiator-new.jpeg)\n\n#### Update, January 2021\n\n![Updated view](assets/radiator-update.png)\n\nAll configuration moved to Firebase, with unique URLs to access different instances; OpenWeatherMap and Google Calendar integration complete." }, { "path": "scribble/TV App.md", "content": "---\ncreatedAt: 2021-12-01T00:01:50+00:00\ntags: \n - project\n---\nKeeping track of TV shows can be a hassle - I'd like a simple web app that I can search for tv shows (and movies), track ones I'd like to watch (or are currently), and mark off episodes to keep track of my progress.\n\nPrototype: [tv.requisite.link](http://tv.requisite.link)." }];

